import { useEffect, useState } from 'react';
import '../css/mainpage/mainpage.css';
import LogicManager from '../businesslogic/LogicManager';


const MainPage = () => {
    let prtList = [];

    const refreshList = async () => {
        const ret = await LogicManager.getInstance().getPraticheManager().loadPratiche();
        prtList = ret;
    }

    return <div className="mainpage-container">
        <h1>
            Benvenuto sulla nostra pagina!
        </h1>
        <div className='text-container'>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque auctor volutpat dolor, a vehicula tortor elementum a. Nulla facilisi. Fusce vitae leo vitae urna fermentum auctor. Sed fringilla, enim nec interdum luctus, lectus ligula mollis ipsum, non convallis justo lorem nec felis. Mauris in metus et ante tempor volutpat eget at justo. Sed id felis urna. Nam vehicula quam ut justo efficitur, in dictum enim iaculis.

            Caratteristiche principali:
            Velocità e efficienza: Prova la nostra piattaforma per ottenere risultati rapidi e senza problemi.
            Affidabilità: Ogni processo è stato ottimizzato per garantire una perfetta esperienza utente.
            Accessibilità: Il nostro sistema è compatibile con vari dispositivi e facilmente navigabile.
            

            Ci sono costi nascosti?
            Fusce id metus et risus tempor sollicitudin. Nulla eget nulla quis enim convallis tempor in et orci.

            Posso cambiare il mio piano in qualsiasi momento?
            Proin quis neque sit amet felis sodales feugiat et sit amet velit. Nulla facilisi.
        </div>
        <div className='text-container'>
        Domande frequenti:
            Come funziona il nostro servizio?
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla facilisi. Vivamus convallis purus eu risus condimentum, eget fermentum arcu euismod.
        </div>
        <div className='pratiche-container'>
            { (prtList && prtList.length>0) &&
             prtList.map(iter => <div className='pratica-container' key={iter.getId()}>
                <div className='id-temp'>
                    id = {iter.getId()}
                </div>
                <div>
                    titolo = {iter.getTitolo()}
                </div>
             </div>)}
        </div>
    </div>
}

export default MainPage;
